import React from "react";
import { Button as MuiButton } from "@material-ui/material/Button";

const Button = ({ label, variant, bgColor, color }) => {
  return (
    <MuiButton variant={variant} style={{ backgroundColor: bgColor, color }}>
      {label}
    </MuiButton>
  );
};

export default Button;
